import Header from '../components/Header/Header'

const Index = () => (
  <div className="index-container">



    <style jsx global>{
      `
      * {
        font-family: Roboto;
        box-sizing: border-box;

      }
      body {
        margin: 0;
        background-color: #071a24;

      }

     h1, p {
       color: #f5f1d0
     }
     h1 {
       font-size: 3rem;
       margin: 0rem
     }
     p {
       margin-top: 0
     }
      .index-container {
        display: flex;
        flex-direction: column;
        justify-content: center;
        padding-left: 3rem;
      }
      `
    }
    </style>
  </div>
)

export default Index
